import React from 'react';
import UsersList from '../components/UsersList';
function Users() {
   const USERS = [
      {
         id: 'u1',
         name: 'Kate Dennings',
         image:
            'https://static.wikia.nocookie.net/disneychannel/images/a/a5/Kat_Dennings.JPG/revision/latest/scale-to-width-down/340?cb=20170101224555',
         places: 5,
      },
   ];

   return (
      <div>
         <UsersList items={USERS} />
      </div>
   );
}

export default Users;
